export default {
  fixed: {
    position: 'fixed',
  },
  absolute: {
    position: 'absolute',
  },
  fill: {
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
  },
  topLeft: {
    top: 0,
    left: 0,
  },
  topRight: {
    top: 0,
    right: 0,
  },
  bottomLeft: {
    bottom: 0,
    left: 0,
  },
  bottomRight: {
    bottom: 0,
    right: 0,
  },
}
